              <TableCell align="right">Age</TableCell>  

              <TableCell align="right">Address</TableCell>  





              <TableCell style={{paddingRight:"60px"}} align="right" >Department</TableCell>  

            </TableRow>  
          </TableHead>  

        </Table>  
      </TableContainer>  
    );  
  }  
}  


